import React, {Component} from 'react';
export default class PopUp extends Component {
    render(){
        let popUp = this.props.isPopUp;
        let _clicked;
        if (popUp === false){
            _clicked = true;
        }else{
            _clicked = false;
        }
        return (
            <div>
                <div className='border bg-yellow padding-md'>
                <h1>Stress level update</h1>
                <input type="button"
                    onClick={function(){
                    this.props.onClickPopUp(_clicked);
                }.bind(this)}></input>
                </div>
            </div>
        )
    }
}
